  assemblies:
  - ANcpLua.Roslyn.Utilities
  namespace: ANcpLua.Roslyn.Utilities
  summary: Extension methods for value tuples providing null-checking and enumeration capabilities.
  remarks: >-
    <p>
        These extension methods simplify common patterns when working with tuples that may contain
        nullable elements, and provide convenient enumeration of tuple elements.
    </p>

    <ul><li>Null-checking methods work with tuples of 2 or 3 elements</li><li>Enumeration methods support tuples from 2 to 5 elements of the same type</li></ul>
